import styled from "styled-component";


const StBox = styled.div`
  width: 100px;
  height: 100px;
  border: 1px solid red;
  margin: 20px;
`;

const Todos = () => {
    return(
    <Layout>
        <todo-container>

            <StBox>
            <div>
            </div> 
            </StBox>     
                    <h1>내 할일</h1>

        </todo-container>
    </Layout>
    )
};

export default Todos;
